import './App.css';
import Cell from "./Components/Cell/Cell"
import { Stage, Layer }  from 'react-konva';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <Stage width={window.innerWidth} height={window.innerHeight}>
      <Layer>
          <Cell 
            x={50}
            y={50}
          />
          <Cell 
            x={52}
            y={50}
          />
      </Layer>
      </Stage>
      </header>
    </div>
  );
}

export default App;
